let candle = record.current
variable.last13.push(candle.close)

if (variable.last13.length > 13) {
    variable.last13.splice(0, 1) // Remove the first element of the array to keep it at a maximun of 200 elements.
}

variable.lips = calculateEMA(5, candle.close, variable.previousEMA5)
variable.previousEMA5 = variable.lips

variable.teeth = calculateSMA(9)

variable.jaw = calculateSMA(13)


function calculateEMA(periods, price, previousEMA) {
    let k = 2 / (periods + 1)
    return price * k + previousEMA * (1-k)
}


function calculateSMA(periods) {  // Having a function avoids us to repeat code.
    /* We check we have enough values to make the calculation */
    if (variable.last13.length < periods) { return 0 } // If we dont, we define the value is zero.

    let sum = 0 // Initialize sum variable. 
    for (let i = variable.last13.length - periods; i < variable.last13.length; i++) { // Iterate through the last periods
        sum = sum + variable.last13[i]
        /*
        if (index > 18 && index < 22) { // You can debug what is going on by console logging whatever you need. 
            console.log("index=" + index + "   i=" + i + "   variable.last13.length=" + variable.last13.length + "   periods=" + periods + "   sum=" + sum + "    sum/periods=" + (sum / periods) + "    currentValue=" + (variable.last13[i]))
        }
        */
    }
    let sma = sum / periods
    return sma
}
